import React from "react";
import axios, { Component } from "axios";
import { Link } from "react-router-dom";
import "./dashboardTournament.css";

class dashboardTournament extends Component {
  constructor() {
    super();
    this.state = {
      Tournaments: [],
    };
  }

  componentDidMount() {
    axios
      .get("http://localhost:5000/tournament/api")
      .then((response) => {
        this.setState({
          Tournaments: response.data,
        });
      })
      .catch((error) => {
        console.log(error);
      });
  }

  render() {
    const { Tournaments } = this.state;
    return (
      <>
        <Link to="/dashboard/tournament/create" className="createButton">
          Create Tournament
        </Link>
        <table>
          <tr>
            <th>Name</th>
            <th>Status</th>
            <th>Prize</th>
            <th>Game</th>
            <th>Region</th>
          </tr>
          {Tournaments.map((Tournaments) => (
            <tr>
              <td>{Tournaments.name}</td>
              <td>{Tournaments.status}</td>
              <td>{Tournaments.prize}</td>
              <td>{Tournaments.game}</td>
              <td>{Tournaments.region}</td>
            </tr>
          ))}
        </table>
      </>
    );
  }
}

export default dashboardTournament;
